const Reducer = (state, action) => {
	switch (action.type) {
		case 'UPDATE_ERROR':
			console.log(state)
			const newState = state
			action.payload.map((ele) => {
				newState.push(ele)
			})
			console.log(newState)
			return newState
		default:
			return state
	}
}
export default Reducer
